import java.util.Random;
import java.util.Scanner;

public class Vettori4 {
	public static void main(String args[]){
		int n, dim, pos = 0;
		int v[];
		boolean trovato = false;
		Scanner ins = new Scanner(System.in);
		Random r = new Random();

		System.out.println("Inserisci la dimensione");
		dim = ins.nextInt();

		v = new int[dim];

		for(int i=0; i<dim; i++){
			v[i] = r.nextInt(50);
		}

		for(int i = 0; i<dim; i++){
			System.out.println(v[i]);
		}

		System.out.println("Inserisci l'elemento da trovare");
		n=ins.nextInt();
		int i = 0;

		while(trovato == false && i<dim){
			if(v[i]==n){
				pos = i;
				trovato = true;
			}else{
				i++;
			}
		}



		ins.close();

		if (trovato)
			System.out.println("La posizione è " + (pos+1));
		else
			System.out.println("Non è stato trovato");
	}
}

